import React from 'react';
import './Contact.css';

const Contact = () => {
  return (
    <main>
      <section id="contact-info">
        <h2>Get in Touch with Us</h2>
        <p>We would love to hear from you! You can reach us via the following methods:</p>
        <ul>
          <li>Email: <a href="mailto:info@srmcollege.edu">info@srmcollege.edu</a></li>
          <li>Phone: +91-1234-567890</li>
          <li>Address: SRM College, 123 College Road, Chennai, India</li>
        </ul>
        <h3>Follow Us on Social Media</h3>
        <ul>
          <li>Facebook: <a href="https://facebook.com/srmcollege" target="_blank" rel="noopener noreferrer">@srmcollege</a></li>
          <li>Twitter: <a href="https://twitter.com/srmcollege" target="_blank" rel="noopener noreferrer">@srmcollege</a></li>
          <li>Instagram: <a href="https://instagram.com/srmcollege" target="_blank" rel="noopener noreferrer">@srmcollege</a></li>
          <li>LinkedIn: <a href="https://linkedin.com/srmcollege" target="_blank" rel="noopener noreferrer">SRM College</a></li>
        </ul>
      </section>
    </main>
  );
};

export default Contact;
